import React from 'react';
import { connect } from 'react-redux'

const state = { is_favorites: false }

class Home extends React.Component {
  state = { is_favorites: false}

  render() {
    return (
      <div>
        <h1>{this.state.is_favorites}</h1>
        Hello this is the weather app home
      </div>
    );
  }
}

const mapStateToProps = state => {
  return { is_favorites: state.auth.is_favorites }
}

export default connect(
  mapStateToProps,
  
)(Home)
